The makings of something new

Guitar chain: 
@fender Deluxe Strat
@fender Super Deluxe Thinline Tele 
@fender Fender Player Tele 

Into the @pettyjohnelec Lift, @bensonamps Preamp (which I never turn off) @greeramps Lightspeed (also pretty much always on)
Running that into the @uaudio RUBY, delay from the STARLIGHT, stereo trem from the ASTRA and some spring verb coming from the @strymonengineering flint. The lead tone curtesy of the blue channel on the @browneamplification Protein, one of my favorites. 
Running the EBOW into the MXR Polyblue for the rich layer of octaves and rotary vibes.

